import React from "react";
import { Route, Routes } from 'react-router-dom';

//Components
import { CustomerPage } from "./views/CustomerPage";


// Style
import settings from './styles/customerPage/settings.css'

function App() {
  return (
    <React.Fragment>

      <Routes>

        <Route path="/" element={<CustomerPage />} />

      </Routes>

    </React.Fragment>
  );
}

export default App;
